import React from "react";

const Receipt = ({ name, source, time }) => {
  return (
    <div>
      <tr>
        <th>Receipt Name</th>
        <th>Receipt Source</th>
        <th>Receipt Time</th>
      </tr>
      <tr>
        <td>{name.value}</td>
        <td>{source.value}</td>
        <td>{time.value}</td>
      </tr>
    </div>
  );
};

export default Receipt;
